import mockApi from './mockApi';

export const usersService = {
  async getProfile() {
    const { data } = await mockApi.getProfile();
    return data;
  },

  async updateProfile(profile) {
    const { data } = await mockApi.updateProfile(profile);
    return data;
  },

  async updateSettings(settings) {
    const { data } = await mockApi.updateSettings(settings);
    return data;
  },

  async updatePassword(passwordData) {
    const { data } = await mockApi.updatePassword(passwordData);
    return data;
  },

  async deleteAccount() {
    const { data } = await mockApi.deleteAccount();
    return data;
  }
};

export default usersService;
